import styles from "./Works.module.scss";
import agencyProjectIcon from "../../images/agency.jpg";
import calcProjecticon from "../../images/calculator.4acb2cf3533331ba63f3.png";

type worksDetail = {
	imgSrc: string;
	text: string;
};

const worksDetails: worksDetail[] = [
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
	{
		imgSrc: calcProjecticon,
		text: "Calculator",
	},
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
	{
		imgSrc: agencyProjectIcon,
		text: "Agency",
	},
];

const Works = () => {
	return (
		<main className="relative h-[82vh] px-28 text-lg text-gray-600">
			<div className="w-full grid grid-cols-2 grid-rows-2 items-center gap-5 justify-items-center">
				{worksDetails.map((detail, i) => (
					<div
						key={i}
						className="flex flex-col items-center gap-1 w-72 h-52 rounded-md shadow-md mt-10"
					>
						<img
							src={detail.imgSrc}
							alt=""
							className="h-3/4 w-full rounded-md"
						/>
						<span>{detail.text}</span>
					</div>
				))}
			</div>
		</main>
	);
};

export default Works;
